  return (
    <nav>
    <form className={"search"} onSubmit={""}>
      <input placeholder={"Search for hashtags here !"}></input>
      <Link to={"/results"}><button>SEARCH ME</button></Link>
    </form>
      <NavLink exact to={"/feedpage"}>
        FEED
      </NavLink>
      <NavLink exact to={"/profilepage"}>
        PROFILE
      </NavLink>
    </nav>
  );
};

export default NavBar;
